objetoCompra:
Caneta personalizada com clip para fixação e acionamento por clique; Cor da escrita: Azul; Material: Plástico; Cor externa da
caneta: Branca (inteira), Clip para fixação no mesmo material e cor da caneta; Acionamento por clique: retração da ponta da caneta ao pressionar o botão superior;
Personalização: O produto deverá ser personalizado com o logotipo da Controladoria Geral do Município de São Paulo, de acordo com as especificações fornecidas pelo órgão.

informacaoComplementar:
a manutenção da filiação do Arquivo Nacional à Associação Brasileira de Editoras Científicas (ABEC) em 2025. Os
benefícios para instituições filiadas são os seguintes: 
representação junto ao governo e às demais entidades do livro; 
desconto na participação em cursos da Universidade do Livro; inclusão de livros no Catálogo Unificado, a custo zero; 
divulgação de livros e iniciativas próprias no informativo semanal e nas mídias digitais; 
facilidade na participação em eventos, como as Bienais Internacionais do Livro de São Paulo e do Rio
